import React, {Component} from 'react';

const Gato = (props) =>{
  return( 
    <div>
      <h1>Gato</h1>
      <pre>
        {JSON.stringify(props, null, 4)}
      </pre>
    </div>
  )
}

class App extends Component {
  render () {
    return (
      <div>
        <Gato/>
      </div>
    )
  }
}

export default App;
